import React from "react";
import "./Alert.css"

export default function Alert(props) {
  return (
    <div className="alert alert-success alert-dismissible fade show" role="alert">
      <strong>{props.alert}</strong>
      <button
        type="button"
        className="btn-close"
        data-bs-dismiss="alert"
        aria-label="Close"
      ></button>
    </div>
  );
}
